measurements.description:
Five relatively flat upright bright pink, lightly distally spotted darker pink, flowers on one 28-cm unsupported inflorescence; 
dorsal sepal slightly relexed distally, oblong; lateral sepals oblong; petals widely elliptical, basal half raised midrib, margin ruffled;
 lip side lobes encircle column, margin ruffled, interior overlaid cream, midlobe ruffled, margin overlaid cream, light yellow centrally, pink tip; 
 column white, anther cap white; substance firm; texture matte.
